@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Transaction a owl:Class .
atm:ErrorMessage a owl:Class .
atm:Card a owl:Class .

atm:isSuccessful a owl:ObjectProperty ;
    rdfs:domain atm:Transaction ;
    rdfs:range rdf:Literal .

atm:displayErrorMessage a owl:ObjectProperty ;
    rdfs:domain atm:Transaction ;
    rdfs:range atm:ErrorMessage .

atm:ejectCard a owl:ObjectProperty ;
    rdfs:domain atm:Transaction ;
    rdfs:range atm:Card .

atm:Transaction rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:isSuccessful ;
    owl:someValuesFrom [
        a owl:Class ;
        owl:complementOf [
            a owl:DataRange ;
            owl:oneOf ( "true"^^xsd:boolean )
        ]
    ]
] .

atm:Transaction rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:displayErrorMessage ;
    owl:someValuesFrom atm:ErrorMessage
] .

atm:Transaction rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:ejectCard ;
    owl:someValuesFrom atm:Card
] .
